INSERT INTO Product (id, name, description, brand, category, price, details, image_url) VALUES (1, 'Nike Mens Air Force 1 07 LV8 Shoes', 'Comfortable, durable and timeless—it’s number 1 for a reason. The classic ‘80s construction pairs with pristine materials for style that tracks whether you’re on court or on the go. A subtle platform gives you just the right amount of height.', 'Nike', 'Air Force', 5860, ARRAY['Durable real and synthetic leather with suede overlays ages to soft perfection.', 'Originally designed for performance hoops, Nike Air cushioning delivers lasting comfort.', 'Low-cut, padded collar looks sleek and feels great.', 'Rubber sole has a full cupsole stitch for exceptional durability.'], ARRAY['https://www.urbanathletics.com.ph/cdn/shop/files/AURORA_FQ8714-003_PHSRH000-2000_2048x2048.png?v=1723792465', 'https://www.urbanathletics.com.ph/cdn/shop/files/AURORA_FQ8714-003_PHCFH001-2000_2048x2048.png?v=1723792465', 'https://www.urbanathletics.com.ph/cdn/shop/files/AURORA_FQ8714-003_PHCBH000-2000_2048x2048.png?v=1723792465', 'https://www.urbanathletics.com.ph/cdn/shop/files/AURORA_FQ8714-003_PHSYD001-2000_2048x2048.png?v=1723792465', 'https://www.urbanathletics.com.ph/cdn/shop/files/AURORA_FQ8714-003_PHSYD002-2000_2048x2048.png?v=1723792465']);
